import React, { useContext, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Catalog.module.css';
import { Context } from 'Context/Context';

export default function Catalog() {
    const { state, dispatch } = useContext(Context);

    useEffect(() => {
        console.log('main: ', state.loading);
    }
    );
    const titles = ['первая', 'вторая', 'третья'];
    const nameLink = ['one', 'two', 'three'];
    return (
        <main className={classes.catalog__container}>
            <h3>Каталог</h3>
            <div className={classes.contacts__container}>
                {titles.map((el, id)=> {
                    return <NavLink key={id+1} to={`/${nameLink[id]}>`}><span className={classes.contacts__cards}>{el}</span></NavLink>
                })}
            </div>
        </main>
  );
}
